import React, { useState } from 'react';
import './Datafetch.css'
import axios from 'axios';

function Datafetch() {
  const [fromDate, setFromDate] = useState('');
  const [toDate, setToDate] = useState('');
  const [scripts, setScripts] = useState('');
  const [timeframe, setTimeframe] = useState('');
  const [method, setMethod] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    const params = {
      fromDate: fromDate,
      toDate: toDate,
      scripts: scripts,
      timeframe: timeframe,
      method: method,
    };
    try {
      const response = await axios.post('http://localhost:8000/fetchdata/fetchdata/',null, { params: params });
      console.log('Response from Django:', response.data);
    } catch (error) {
      console.error('Error sending request:', error);
    }
  };


  return (
    <>
      <div className='analysis_page'>
        <div className='query_container'>


          <form className='queryform' onSubmit={handleSubmit}>
            <div className='grid_items'>

              <input
                type="text"
                id="scripts"
                value={scripts}
                onChange={(e) => setScripts(e.target.value)}
                placeholder='Script name'
                required
                title='Enter the script name '
              />
            </div>
            <div className='grid_items'>
              <input
                type="date"
                id="fromDate"
                value={fromDate}
                placeholder='From date'
                onChange={(e) => setFromDate(e.target.value)}
                required
              />
            </div>
            <div className='grid_items'>
              <input
                type="date"
                id="toDate"
                value={toDate}
                placeholder='To date'
                onChange={(e) => setToDate(e.target.value)}
                required
              />
            </div>

            <div className='grid_items'>
              <select
                id="timeframe"
                value={timeframe}
                onChange={(e) => setTimeframe(e.target.value)}
                placeholder='Time frame'
                required
              >
                <option value="">Select timeframe</option>
                <option value="1D">1 Day</option>
                <option value="1W">1 Week</option>
                <option value="1M">1 Month</option>
                <option value="3M">3 Months</option>
                <option value="6M">6 Months</option>
                <option value="1Y">1 Year</option>
                <option value="YTD">Year to Date</option>
                <option value="ALL">All</option>
              </select>
            </div>
            <div className='grid_items'>
              <select
                id="timeframe"
                value={method}
                onChange={(e) => setMethod(e.target.value)}
                placeholder='Method name'
                title="method name"
                required
              >
                <option value="">Select method</option>
                <option value="30M_ORB">30M ORB</option>
                <option value="HL_ORB">HLORB</option>

              </select>
            </div>


            <div className='grid_items'>
              <button type="submit">Submit</button>

            </div>
          </form>

        </div>
      </div>
    </>);

}

export default Datafetch;
